package com.xjtu.ssmidea.leetcode;

//给定字符串s和字符串t，检查s是否是t的子序列。
//您可以假设s和t中只有小写英文字母。 t可能是一个非常长（长度〜= 500,000）的字符串，s是一个短字符串（<= 100）
//字符串的子序列是一个新字符串，它是通过删除一些（可以是无）字符而不干扰其余字符的相对位置而从原始字符串形成的。 （即“ace”是“abcde”的子序列，而“aec”不是）
//Example 1:
//s = "abc", t = "ahbgdc"
//
//Return true.
//
//Example 2:
//s = "axc", t = "ahbgdc"
//
//Return false.
public class demo40_IsSubsequence {

    public static void main(String[] args) {
        String s = "leeeeetcode", t = "";
        boolean subsequence = isSubsequence3(s, t);
        System.out.println(subsequence);
    }

    private static boolean isSubsequence3(String s, String t) {
        int i = 0;
        int j = 0;
        int count = 0;
        while (i < s.length() && j < t.length()) {
            if (s.charAt(i) == t.charAt(j)) {
                count++;
                i++;
                j++;
            } else {
                j++;
            }
        }

        return count == s.length();
    }

    private static boolean isSubsequence2(String s, String t) {
        if (s.length() == 0) return true;
        int indexS = 0, indexT = 0;
        while (indexT < t.length()) {
            if (t.charAt(indexT) == s.charAt(indexS)) {
                indexS++;
                if (indexS == s.length()) return true;
            }
            indexT++;
        }
        return false;
    }

    public static boolean isSubsequence(String s, String t) {
        if (s.length() > 100) return false;
        int index1 = -1;
        for (int i = 0; i < s.length(); i++) {
            if (t.indexOf(s.charAt(i)) > index1) {
                index1 = t.indexOf(s.charAt(i));
            } else if (index1 > -1) {
                t = t.substring(i + 1, t.length());
                index1 = -1;
                i--;
            } else {
                return false;
            }
        }
        return true;
    }
}
